('node', 'article', 0, 2, 2, 'und', 0, '<center >\r\n<a href="#"><img src="../images/index_box.jpg" border=0 width="780" height="400" /></a>\r\n<div style=''margin-top: 24px;''><h1>"Экспресс файлы" - сервис обмена информацией.</h1>\r\n<p>\r\nВы можете анонимно воспользоваться сервисом хранения, пересылки и обмена файлов, в этом случае<br />\r\nдоступ к объекту будет возможен только с помощью ключа, который Вы получите при создании объекта.<br />\r\nЕсли объект не использовался более 30 дней, он может быть удален системой.\r\n</p>\r\n<form method="post" action="#">\r\n<input type="submit" value="создать" class="button">\r\n</form>\r\n<p>\r\nДля получения доступа к информации по ключу можете воспользоваться формой ниже.\r\n</p>\r\n<form method="post" action="#">\r\n<input type="text" name="key" value="" style="width: 120px;" autocomplete="off" maxlength=12>\r\n<input type="submit" value="получить" class="button">\r\n</form></div></center>\r\n<script type=''text/javascript''>\r\nfunction initStorage()\r\n{\r\n	var f = document.forms[''storage''];\r\n	if (f)\r\n	{\r\n		var e = f.elements[''key''];\r\n		if (e) e.focus();\r\n	}\r\n}\r\n\r\nonLoadAction.push(initStorage);\r\n</script>', '', 'full_html'),
('node', 'file', 0, 3, 3, 'und', 0, '==========================================\r\nГод выпуска: 2012\r\nСтрана: Россия\r\nЖанр: Триллеры, Драмы, Наши\r\nПродолжительность: 02:11:44\r\nРейтинг фильма: IMDB: 6.7 Кинопоиск: 7.52\r\n==========================================\r\n\r\nСюжет:\r\nШироко развернувшееся в центре Москвы строительство новых зданий приводит к тому, что в одном из тоннелей метро между двумя станциями возникает трещина. Никто себе и представить не мог, что в результате нарушения герметичности перекрытия в тоннель хлынет вода из Москва-реки, и сотни пассажиров поезда окажутся во власти надвигающегося потопа. Бешеный поток воды грозит не только обрушением тоннелей метро, но и разрушением всего города.\r\n\r\nСреди попавших в беду людей — врач городской больницы Андрей Гарин и его дочь Ксюша. Гарин сражается с катастрофой, пытаясь спасти оставшихся в живых пассажиров, в том числе и .любовника своей жены. Гарину придется побороть обиду, гнев и страх. Он должен выжить, чтобы вернуть свою любовь, семью. свою прежнюю счастливую жизнь.\r\n\r\nАктеры:\r\nСергей Пускепалис, Анатолий Белый, Анфиса Вистингаузен, Алексей Бардуков, Катерина Шпица, Елена Панова, Станислав Дужников, Светлана Ходченкова, Сергей Сосновский, Ярослав Жалнин ', '', 'filtered_html'),
('node', 'file', 0, 4, 4, 'und', 0, 'Исполнитель: Carla Bruni \r\nАльбом: Little French Songs\r\nГод выхода: 2013\r\nСтрана: France\r\nКачество: MP3 320 kbps\r\nТреклист:\r\n01. J’arrive à toi\r\n02. Mon raymond\r\n03. Prière\r\n04. Pas une dame\r\n05. Dolce francia\r\n06. Chez keith et anita\r\n07. Darling\r\n08. La valse posthume\r\n09. Liberté\r\n10. Little french song\r\n11. Le pingouin\r\n12. La blonde exquise (Bonus Track)\r\n13. Lune (Bonus Track)\r\n14. J’arrive à toi (Live acoustique) [Video]\r\n15. Mon Raymond (Live acoustique) [Video]\r\n16. Chez Keith et Anita (Live acoustique) [Video]\r\n17. Liberté (Live acoustique) [Video]\r\n18. Little French Song (Live acoustique) [Video]', '', 'filtered_html'),
('node', 'file', 0, 6, 6, 'und', 0, '==========================================\r\nГод выпуска: 2012\r\nСтрана: Россия\r\nЖанр: Триллеры, Драмы, Наши\r\nПродолжительность: 02:11:44\r\nРейтинг фильма: IMDB: 6.7 Кинопоиск: 7.52\r\n==========================================\r\n\r\nСюжет:\r\nШироко развернувшееся в центре Москвы строительство новых зданий приводит к тому, что в одном из тоннелей метро между двумя станциями возникает трещина. Никто себе и представить не мог, что в результате нарушения герметичности перекрытия в тоннель хлынет вода из Москва-реки, и сотни пассажиров поезда окажутся во власти надвигающегося потопа. Бешеный поток воды грозит не только обрушением тоннелей метро, но и разрушением всего города.\r\n\r\nСреди попавших в беду людей — врач городской больницы Андрей Гарин и его дочь Ксюша. Гарин сражается с катастрофой, пытаясь спасти оставшихся в живых пассажиров, в том числе и .любовника своей жены. Гарину придется побороть обиду, гнев и страх. Он должен выжить, чтобы вернуть свою любовь, семью. свою прежнюю счастливую жизнь.\r\n\r\nАктеры:\r\nСергей Пускепалис, Анатолий Белый, Анфиса Вистингаузен, Алексей Бардуков, Катерина Шпица, Елена Панова, Станислав Дужников, Светлана Ходченкова, Сергей Сосновский, Ярослав Жалнин ', '', 'filtered_html'),
('node', 'file', 0, 7, 7, 'und', 0, ' ==========================================\r\nГод выпуска: 2012\r\nСтрана: Россия\r\nЖанр: Комедии, Наши\r\nПродолжительность: 01:23:36\r\nРейтинг фильма: ==========================================\r\n\r\nСюжет:\r\nСева работает массажистом в салоне красоты “8 рук”. Практически, эти восемь рук он и заменяет, потому что многие клиентки хотят записаться именно к Севе. Дело в том, что кудесник массажа очень “смахивает” на звезду шоу-бизнеса Игоря Успенского, и вообразить, что их тело ощущает тепло рук мегазвезды, хочется многим. Сам же Успенский настолько погружен в творческую гонку за популярностью, что даже не принадлежит себе, и за неисполнение супружеского долга давно поставлен своей женой “на счетчик”. Можно сказать и так: Успенского на всех не хватает. Узнав о существовании двойника, Игорь понял, что его может стать больше. Он делает предложение Севе стать его дублером, абсолютно не думая о том, что копия иногда может быть лучше оригинала.\r\n\r\nАктеры:\r\nАлександр Ревва, Кристина Асмус, Дмитрий Хрусталев, Людмила Артемьева, Татьяна Орлова, Ксения Буравская, Варвара Малкова, Александра Кимаева, Евгений Шиманович, Алексей Рязанцев ', '', 'filtered_html'),
