('node', 'page', 0, 9, 9, 'und', 0, '<p>\r\nУважаемый Правообладатель,<p>\r\n\r\nЕсли вы являетесь обладателем соответствующих Прав интеллектуальной собственности относительно какого-либо Контента, размещенного Пользователями с использованием нашего Сервиса, и вы считаете такое размещение нарушением ваших Прав, мы будем рады помочь вам в закрытии доступа к такому Контенту.<p>\r\n\r\nДля того, чтобы сообщить нам о предполагаемом нарушении, пожалуйста, пришлите нам письмо по адресу <a href=''mailto:support@ex.ua''>support@ex.ua</a>, предоставив в нем следующий необходимый минимум информации:<p>\r\n\r\n(a) Название/Имя Правообладателя;<br>\r\n(b) Ваше имя, если отличается от (a), а также утверждение относительно вашего статуса представлять Правообладателя;<br>\r\n(c) Прямая(-ые) ссылки (URL(s)) на веб-страницы, содержащие и/или непосредственно ведущие к Контенту, размещение которого составляет предполагаемое нарушение. Ссылки должны иметь вид http://www.ex.ua/view/______ либо подобный;<br>\r\n(d) Ваше Заявление относительно соответствующих Прав на Контент.<p>\r\n\r\nВы свободны подавать электронные (сканированные) копии любых документов в поддержку ваших заявлений. Мы также оставляем за собой право запросить, по нашему усмотрению и в любом случае, когда мы посчитаем нужным, электронные (сканированные) копии документов, подтверждающих вашу личность, статус и/или действительность вашего права запрещать распространение Контента в Интернет.<p>\r\n\r\n<b>Пожалуйста, обратите внимание на следующее:</b><p>\r\n\r\nМы оставляем за собой право опубликовать и/или передать третьим лицам любую информацию, полученную нами по адресу <a href=''mailto:support@ex.ua''>support@ex.ua</a>.<p>\r\n\r\nДалее, пожалуйста, обратите внимание на то, что заявления, полученные по адресу <a href=''mailto:support@ex.ua''>support@ex.ua</a>, обычно, без ущерба нашему праву делать исключения, публикуются в специальном разделе нашего Сервиса “Жалобы Правообладателей”.<p>\r\n\r\nПожалуйста, заметьте фундаментальным образом, что мы предоставляем Сервис Информационного Общества, состоящий в хранении информации, предоставленной Пользователями. Перед размещением Контента, каждый Пользователь подтверждает свое согласие соблюдать Условия предоставления Сервиса (Правила размещения информации), согласно которым Пользователь подтверждает и гарантирует, что он/она обладает полным правом размещать Контент, и что, насколько известно Пользователю, размещение Контента не нарушает Прав интеллектуальной собственности третьих лиц. Мы уверены, что большинство наших Пользователей действительно соблюдают Условия предоставления Сервиса (Правила размещения информации). Мы не несем ответственности за информацию, что хранится по запросам Пользователей, до тех пор, пока мы не уведомлены должным образом о действительном нарушении. Как провайдер Сервиса, мы не несем ни общего обязательства отслеживать информацию, которую мы храним, ни общего обязательства активно искать факты нарушения Прав. Все размещения Контента Пользователями будут считаться легитимным использованием Сервиса Информационного Общества, до тех пор, пока не будет достаточных оснований считать иначе.<p>\r\n\r\nНаконец, пожалуйста, обратите внимание, что мы рассматриваем сотрудничество как ценность, и большинство жалоб действительно разрешаются позитивным образом — что может быть легко засвидетельствовано упомянутым выше разделом “Жалобы Правообладателей”.<p>\r\n\r\nМы оставляем за собой право изменять настоящую Политику на наше усмотрение в любое время.', '', 'full_html');
