('node', 'article', 0, 2, 2, 'und', 0, '<center >\r\n<a href="#"><img src="../images/index_box.jpg" border=0 width="780" height="400" /></a>\r\n<div style=''margin-top: 24px;''><h1>"Экспресс файлы" - сервис обмена информацией.</h1>\r\n<p>\r\nВы можете анонимно воспользоваться сервисом хранения, пересылки и обмена файлов, в этом случае<br />\r\nдоступ к объекту будет возможен только с помощью ключа, который Вы получите при создании объекта.<br />\r\nЕсли объект не использовался более 30 дней, он может быть удален системой.\r\n</p>\r\n<form method="post" action="#">\r\n<input type="submit" value="создать" class="button">\r\n</form>\r\n<p>\r\nДля получения доступа к информации по ключу можете воспользоваться формой ниже.\r\n</p>\r\n<form method="post" action="#">\r\n<input type="text" name="key" value="" style="width: 120px;" autocomplete="off" maxlength=12>\r\n<input type="submit" value="получить" class="button">\r\n</form></div></center>\r\n<script type=''text/javascript''>\r\nfunction initStorage()\r\n{\r\n	var f = document.forms[''storage''];\r\n	if (f)\r\n	{\r\n		var e = f.elements[''key''];\r\n		if (e) e.focus();\r\n	}\r\n}\r\n\r\nonLoadAction.push(initStorage);\r\n</script>', '', 'full_html'),
