('node', 'file', 0, 7, 7, 'und', 0, ' ==========================================\r\nГод выпуска: 2012\r\nСтрана: Россия\r\nЖанр: Комедии, Наши\r\nПродолжительность: 01:23:36\r\nРейтинг фильма: ==========================================\r\n\r\nСюжет:\r\nСева работает массажистом в салоне красоты “8 рук”. Практически, эти восемь рук он и заменяет, потому что многие клиентки хотят записаться именно к Севе. Дело в том, что кудесник массажа очень “смахивает” на звезду шоу-бизнеса Игоря Успенского, и вообразить, что их тело ощущает тепло рук мегазвезды, хочется многим. Сам же Успенский настолько погружен в творческую гонку за популярностью, что даже не принадлежит себе, и за неисполнение супружеского долга давно поставлен своей женой “на счетчик”. Можно сказать и так: Успенского на всех не хватает. Узнав о существовании двойника, Игорь понял, что его может стать больше. Он делает предложение Севе стать его дублером, абсолютно не думая о том, что копия иногда может быть лучше оригинала.\r\n\r\nАктеры:\r\nАлександр Ревва, Кристина Асмус, Дмитрий Хрусталев, Людмила Артемьева, Татьяна Орлова, Ксения Буравская, Варвара Малкова, Александра Кимаева, Евгений Шиманович, Алексей Рязанцев ', '', 'filtered_html'),
