(2, 'node', ' головна  экспресс файлы сервис обмена информацией вы можете анонимно воспользоваться сервисом хранения пересылки и обмена файлов в этом случае доступ к объекту будет возможен только с помощью ключа который вы получите при создании объекта если объект не использовался более 30 дней он может быть удален системой для получения доступа к информации по ключу можете воспользоваться формой ниже  ', 0),
(3, 'node', ' метро 2012 1080p  год выпуска 2012 страна россия жанр триллеры драмы наши продолжительность 21144 рейтинг фильма imdb 67 кинопоиск 752 сюжет широко развернувшееся в центре москвы строительство новых зданий приводит к тому что в одном из тоннелей метро между двумя станциями возникает трещина никто себе и представить не мог что в результате нарушения герметичности перекрытия в тоннель хлынет вода из москвареки и сотни пассажиров поезда окажутся во власти надвигающегося потопа бешеный поток воды грозит не только обрушением тоннелей метро но и разрушением всего города среди попавших в беду людей врач городской больницы андрей гарин и его дочь ксюша гарин сражается с катастрофой пытаясь спасти оставшихся в живых пассажиров в том числе и любовника своей жены гарину придется побороть обиду гнев и страх он должен выжить чтобы вернуть свою любовь семью свою прежнюю счастливую жизнь актеры сергей пускепалис анатолий белый анфиса вистингаузен алексей бардуков катерина шпица елена панова станислав дужников светлана ходченкова сергей сосновский ярослав жалнин  ', 0),
